import "./style.css";
import Post from './records.json';

function DataFetching() {


    <div className="post">
        {Post.map(Post => (
            <div key={Post.id}>
                <h3>{Post.title}</h3>
                <p>{Post.content}</p>
            </div>
        ))}

    </div>
}
export default DataFetching
